<?php

namespace Appleton\Taxes\Seeds\US\Alabama;

use Appleton\Taxes\Countries\US\Alabama\BearCreekOccupational;
use DB;
use Illuminate\Database\Seeder;

class BearCreekSeeder extends Seeder
{
    public function run()
    {
        $id = DB::table(config('taxes.governmental_unit_areas'))->insertGetId([
            'name' => 'Bear Creek, AL',
            'area' => '',
        ]);

        DB::table(config('taxes.tax_areas'))->insert([
            'name' => 'Bear Creek Occupational Tax',
            'tax' => BearCreekOccupational::class,
            'governmental_unit_area_id' => $id,
        ]);
    }
}
